import React from 'react';
import PersonCard from './PersonCard';

const PersonList = ({ people, onEdit, onDelete }) => {
  return (
    <div className="container">
      {people.map((person) => (
        <PersonCard
          key={person.id}
          person={person}
          onEdit={onEdit}
          onDelete={onDelete}
        />
      ))}
    </div>
  );
};

export default PersonList;
